'''
有一个NxN整数矩阵，请编写一个算法，将矩阵顺时针旋转90度。
给定一个NxN的矩阵，和矩阵的阶数N,请返回旋转后的NxN矩阵,保证N小于等于300。
测试样例：
[[1,2,3],[4,5,6],[7,8,9]],3
返回：[[7,4,1],[8,5,2],[9,6,3]]
'''
class Rotate:
    def rotateMatrix(self, mat, n):
        ss=[[] for i in range(n)]
        for i in range(n):
            for j in range(n):
                ss[i].append(mat[n-j-1][i])
        return ss

